// components/Section.js
import React from 'react';

function Section({ id, title, children }) {
  return (
    <section id="introduction">
        <h2>PROFESSIONAL SUMMARY</h2>
        <p id="typing-text"></p>
    </section>
    
  );
}

export default Section;
